import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
import './App.css';
import MyAppBar from "./components/AppBar";
import BookNow from './BookNow';
import RoomType from "./roomType";
import BrandingSignInPage from "./components/signin";
import FacilitiesPage from "./FacilitiesPage";
import ContactUsPage from "./ContactUsPage";
import BookNowDouble from "./BookNowDouble ";
import Bookservices from "./Bookservices";
import ConfirmationPage from './confirmation';
import Profile from "./profilePage";
import RegistrationPage from "./components/register";
import Bookings from "./Bookings";
import Footer from "./components/footer";
import React, { useState, useEffect } from 'react';
import { ThemeProvider } from 'styled-components';
import GlobalStyle from './GlobalStyle'; // Global styling for theme

function App() {
  const [theme, setTheme] = useState('light'); // Default theme is light

  // Load theme from localStorage if available
  useEffect(() => {
    const savedTheme = localStorage.getItem('theme');
    if (savedTheme) {
      setTheme(savedTheme);
    }
  }, []);

  // Toggle between light and dark theme
  const toggleTheme = () => {
    const newTheme = theme === 'light' ? 'dark' : 'light';
    setTheme(newTheme);
    localStorage.setItem('theme', newTheme); // Save theme to localStorage
  };

  return (
    <ThemeProvider theme={{ mode: theme }}>
      {/* GlobalStyle applies the theme styles globally */}
      <GlobalStyle />

      <Router>
        <Box
          sx={{
            minHeight: "100vh", // Full viewport height
            backgroundImage: "url('./background2.jpg')", // Background image
            backgroundSize: "cover", // Ensures the image covers the whole area
            backgroundPosition: "center", // Centers the image
            backgroundRepeat: "no-repeat", // Prevents repeating
          }}
        >
          {/* AppBar */}
          <MyAppBar />

          {/* Dark Mode Toggle Button */}
          <Button
  onClick={toggleTheme}
  sx={{
    position: 'absolute',
    top: '16px',
    right: '16px',
    backgroundColor: theme === 'light' ? '#6200ea' : '#03dac6', // Change button color based on the theme
    color: '#fff', // Text color
    borderRadius: '8px',
    padding: '8px 16px',
    '&:hover': {
      backgroundColor: theme === 'light' ? '#3700b3' : '#018786', // Hover effect based on the theme
    },
  }}
>
  {theme === 'light' ? 'Switch to Dark Mode' : 'Switch to Light Mode'}
</Button>


          {/* Routes setup */}
          <Routes>
            {/* Home Page Route */}
            <Route path="/" element={
              <Box
                sx={{
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                  minHeight: 'calc(100vh - 64px)', // Leaves space for AppBar
                }}
              >
                <BrandingSignInPage />
              </Box>
            } />

            {/* Other routes */}
            <Route path="/room-Type" element={<RoomType />} />
            <Route path="/Book-Now" element={<BookNow />} />
            <Route path="/signinPage" element={<BrandingSignInPage />} />
            <Route path="/facilities" element={< FacilitiesPage />} />
            <Route path="/about-us" element={< ContactUsPage />} />
            <Route path="/book-now-double" element={< BookNowDouble />} />
            <Route path="/Bookservices" element={< Bookservices />} />
            <Route path="/profile" element={< Profile />} />
            <Route path="/register" element={<RegistrationPage />} />
            <Route path="/confirmation" element={<ConfirmationPage />} />
            <Route path="/Bookings" element={<Bookings />} />
          </Routes>

          {/* Footer */}
          <Footer />
        </Box>
      </Router>
    </ThemeProvider>
  );
}

export default App;
